def solution(stdin: str) -> str:
    X, N = map(int, stdin.split())
    megabytes = [0] * N
    prev_megabytes = [0] * N

    for p in range(N):
        megabytes[p] = X * (p + 1)
        prev_megabytes[p] = megabytes[p - 1]

    remaining_megabytes = X * N
    total_megabytes = sum(megabytes)

    while remaining_megabytes > 0:
        max_possible = min(remaining_megabytes, total_megabytes)
        remaining_megabytes -= max_possible

        for i in range(N - 1, -1, -1):
            megabytes[i] = prev_megabytes[i] + megabytes[i + 1]
            prev_megabytes[i] = megabytes[i]

    return str(sum(megabytes))

