    count = 0
    for stone in s:
        if stone == 'B':
            count += 1
        elif stone == 'W':
            count -= 1

    # If the number of black stones and white stones is odd, it is impossible for Ming to balance the stones
    if count % 2 == 1:
        return '0'

    # Find the index of the first black stone
    first_black_index = -1
    for i, stone in enumerate(s):
        if stone == 'B':
            first_black_index = i

    # Find the index of the first white stone
    first_white_index = -1
    for i, stone in enumerate(s):
        if stone == 'W':
            first_white_index = i

    # If the first stone is adjacent to the last stone, it is impossible for Ming to balance the stones
    if s[0] == s[-1]:
        return '0'

    # Replace the first and last stone with a single black stone
    s = s[:first_black_index] + 'B' + s[first_black_index + 1:] + 'W' + s[first_white_index:]

    # If the first and last stone are the same, it is impossible for Ming to balance the stones
    if s[0] == s[-1]:
        return '0'

    return '1'

